  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for LaCreek National
  Wildlife Refuge outlines Refuge accomplishments from January through April of 1951.
  The report begins by summarizing the weather conditions, water conditions, habitat
  conditions, and food and cover during this period. Wildlife- including migratory
  birds, upland game birds, furbearers, predators, rodents, raptors, and fish- is
  also covered. The Refuge development and maintenance section discusses physical
  developments, plantings, wildfires. Resource management is outlined; topics include
  grazing and fur harvesting.  The public relations section of the report describes
  recreational uses, Refuge visitors, Refuge participation, fishing, and violations.
  N-R forms and photographs are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
